import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import "../sass/style.scss";
import { Link } from "react-router-dom";
import Copyright from "../images/copyrights.svg";

const Footer = () => (
  <>
    <div id="wrap">
      <div id="main" className="App clear-top ">
        {/* full footer row */}
        <Row>
          {/* column for copyrights */}
          <Col lg={4}>
            {/* row for copyrights */}

            <Row>
              <Col lg={1}>
                <img className="img-fluid col-centered" src={Copyright} />
              </Col>
              <Col lg={11}>
                <p>2020 Hira Fareed</p>
              </Col>
            </Row>
          </Col>

          {/* end of copyrights column */}

          {/* row for email */}

          <Col lg={4}>
            <Row>
              <p>hirafareedkapadia@gmail.com</p>
            </Row>
          </Col>

          {/* end of row for email */}

          <Col lg={4}>
            {/* row for contact links */}
            <Row>
              <p>Behance</p>
              <p>LinkedIn</p>
              <p>Dribble</p>
            </Row>
          </Col>

          {/* end of row for contact links */}
        </Row>
      </div>
    </div>
    <footer class="footer"></footer>
  </>
);

export default Footer;
